import {createStore, combineReducers} from "redux";
import usersReducer from './reducers/usersR.js';
import filmsReducer from './reducers/filmsR.js';
import booksReducer from './reducers/booksR.js';
import commentsReducer from './reducers/commentsR.js';

let reducers = combineReducers({
  usersR: usersReducer,
  filmsR: filmsReducer,
  booksR: booksReducer,
  commentsR: commentsReducer
});

let store = createStore(reducers);
console.log(store.filmsR)

export default store;
